import React from 'react';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

export default function Home() {
  return (
    <div className='home'>
      <Container maxWidth='xl'>
        <Box>
          <img src='https://img.freepik.com/free-vector/isometric-laptop-with-shopping-cart-keypad_1262-16544.jpg?w=900&t=st=1707025145~exp=1707025745~hmac=9449df8e88a38db1499338a3d30903bde219eabe02dc535ef3b447ea9b98764b' height='500px' width='500px'/>
        </Box>
      </Container>
    </div>
  )
}
